import { createAsyncThunk } from "@reduxjs/toolkit"
export const loginUserThunk=createAsyncThunk(
    'userLogin',
    async (payload)=>{
        console.log('payload',payload);
        const user =await fetch("http://example.com/movies.json")
        console.log('user',user);
        // if(user.success){
        //     return user
        // }
    }
)
